package br.com.elvisassis.mscartoes.domain;import jakarta.persistence.*;import lombok.Data;import lombok.NoArgsConstructor;import java.math.BigDecimal;@Entity@NoArgsConstructor@Datapublic class CardClient {  @Id  @GeneratedValue(strategy = GenerationType.IDENTITY)  private Long id;  @Column(name = "cpf")  private String cpf;  @ManyToOne  @JoinColumn(name = "id_card")  private Card card;  @Column(name = "limit_value")  private BigDecimal limit;  public CardClient(String cpf,  BigDecimal limit) {    this.cpf = cpf;    this.card = card;    this.limit = limit;  }  public CardClient(CardClient cardClient) {  }}